import React from "react";
import Header from "./components/Header";
import Home from "./components/Home"
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <React.Fragment>
      <header>
        <Header />
      </header>
      <main>
        <Routes>
          <Route path="/" element={<Home />} exact />
          <Route path="/add" element={<Add />} exact />
          <Route path="/" element={<Home />} exact />
        </Routes>
      </main>
    </React.Fragment>
  );
}

export default App;
